.vehicle-detail {
    .select-store{
        .modal-dialog{
            max-width: 800px;
        }
        .select-box{
            display: flex;
            justify-content: space-between;
            align-items: center;
            .col-md-4{
                padding-left: 0;
            }
            .col-md-8{
                padding-right: 0;
            }
            p{
                margin-bottom: 0;
            }
        }
    }
    .row {
        border-bottom: 1px solid #23282c;
        padding: .75rem 1.25rem;

        .img-box {
            width: 100%;
        }
    }
    .gaode-fullscreen{
        background: #ffffff; width: 30px;height: 30px;text-align: center;line-height: 30px;
        position: absolute;
        z-index: 1;
        right: 6px;
        top: 6px;
    }

    .show-map .modal-dialog {
        width: 80%;
        max-width: 1200px;
    }

    .user-table-list {
        margin-top: 20px;

        .link-detail {
            color: #20a8d8 !important;
            cursor: pointer;

            &:hover {
                text-decoration: underline !important;
                color: #167495 !important;
            }
        }
    }
}

.vehicle-detail {
    .card-body {
        padding: 0 1.25rem;
    }

    .title {
        font-size: 18px;
        color: #63c2de;
    }

    .card {
        margin: 0 auto;
    }

    .hidden {
        display: none;
    }

    .left {
        padding: 10px;
        padding-top: 0;

        .row {
            margin: 0px;
            border-bottom: 1px solid #23282c;
            padding: 10px;
        }

        .row > div {
            padding-left: 4px;
        }
    }

    .right {
        .table thead th {
            color: grey;
        }

        #map {
            height: 40vh;
        }
    }
}
